The if keyword can be used to add a guard expression to a case clause. Both the patterns have to match and the guard has to evaluate to True for the clause to match. The guard expression can check for equality or ordering for Int and Float. case xs { [a, b, c] if a == b && b != c -> "ok" _other -> "ko"
} case xs { [a, b, c] if a >. b && a <=. c -> "ok" _other -> "ko"
}

