Named functions in Gleam are defined using the pub fn keywords. pub fn add(x: Int, y: Int) -> Int { x + y
} pub fn multiply(x: Int, y: Int) -> Int { x * y
} Functions in Gleam are first class values and so can be assigned to variables, passed to functions, or anything else you might do with any other data type. // This function takes a function as an argument
pub fn twice(f: fn(t) -> t, x: t) -> t { f(f(x))
} pub fn add_one(x: Int) -> Int { x + 1
} pub fn add_two(x: Int) -> Int { twice(add_one, x)
}

