Gleam programs are made up of bundles of functions and types called modules. Each module has its own namespace and can export types and values to be used by other modules in the program. // inside src/nasa/rocket_ship.gleam fn count_down() { "3... 2... 1..."
} fn blast_off() { "BOOM!"
} pub fn launch() { [ count_down(), blast_off(), ]
} Here we can see a module named nasa/rocket_ship, the name determined by the filename src/nasa/rocket_ship.gleam. Typically all the modules for one project would live within a directory with the name of the project, such as nasa in this example. For the functions count_down and blast_off we have omitted the pub keyword, so these functions are private module functions. They can only be called by other functions within the same module.

