Gleam's custom types are named collections of keys and values. They are similar to objects in object oriented languages, though they don't have methods. Custom types are defined with the type keyword. pub type Cat { Cat(name: String, cuteness: Int)
} Here we have defined a custom type called Cat. Its constructor is called Cat and it has two fields: A name field which is a String, and a cuteness field which is an Int. The pub keyword makes this type usable from other modules. Once defined the custom type can be used in functions: fn cats() { // Labelled fields can be given in any order let cat1 = Cat(name: "Nubi", cuteness: 2001) let cat2 = Cat(cuteness: 1805, name: "Biffy") // Alternatively fields can be given without labels let cat3 = Cat("Ginny", 1950) [cat1, cat2, cat3]
}

