Custom types in Gleam can be defined with multiple constructors, making them a way of modeling data that can be one of a few different variants. We've seen a custom type with multiple constructors already in this chapter - Bool. Bool is defined like this: // A Bool is a value that is either `True` or `False`
pub type Bool { True False
} The records created by different constructors for a custom type can contain different values. For example a User custom type could have a LoggedIn constructors that creates records with a name, and a Guest constructor which creates records without any contained values. type User { LoggedIn(name: String) // A logged in user with a name Guest // A guest user with no details
} let sara = LoggedIn(name: "Sara")
let rick = LoggedIn(name: "Rick")
let visitor = Guest

