The gleam/result module in the standard library defines Option(value) as an alias for Result(value, Nil). This alias is useful for when you wish to return a value that may or may not be present. This is a type safe alternative to a value that may be null in other languages. import gleam/result.{Option} pub fn present() -> Option(Int) { Ok(1) // This Int is present
} fn not_present() -> Option(Int) { Error(Nil) // This Int is not present
} fn also_not_present() -> Option(Int) { result.none() // Error(Nil) can also be written like this
