To document modules and functions Gleam supports two special comments, /// which is for documenting types and functions, and //// which is for documenting the module as a whole. //// This module contains some useful functions for working
//// with numbers.
////
//// For more information see [this website](https://example.com). import gleam/result /// A type for representing numbers
pub type Number { /// This constructor is used when the number is an Int I(Int) /// This constructor is used when the number is an Float F(Float)
} /// Returns the next number
///
/// # Examples
///
/// > successor(1)
/// 2
///
pub fn successor(i: Int) -> Int { i + 1
} /// Returns a number held by an Ok record, returning a default if the
/// Result is an Error record.
///
/// # Examples
///
/// > from_result(Ok(1))
/// 1
///
/// > from_result(Error(Nil))
/// 0
///
pub fn from_result(result: Result(Int, e)) -> Int { result.unwrap(result, 0)
} Once documentation comments have been added Gleam can generate HTML documentation for the project.

