pages = [ { title = "Hello", path = "hello.html", source = "docs/hello_world.md" }, { title = "Testing", path = "testing.html", source = "docs/testing.md" },
] Links will automatically be generated for these additional pages and the Markdown will be converted into HTML documentation. Your project's README.md file will automatically be used to generate the default page for the documentation.

